/*SE MODIFICA LA OPCION DE MENÚ QUE LE CORRESPONDE A LOS ROLES CON PERMISOS DE CONSULTA SOBRE LA PANTALLA CONSULTA DE AGENTES*/
UPDATE
MENU_OPCIONROL
SET COPCION = 4003 
WHERE CROLMEN NOT IN ('0008-01', 'FULL_ACCESS') AND COPCION = 4001;
